import React from "react"
import Menu from "./props3/menu"
import Toggler from "./props3/Toggler"
import Favourite from "./props3/favourite"

function App() {
    return (
        <div>
            <Toggler defaultOnValue={true}>
                {({on, toggle}) => {
                    return (
                        <Menu on={on} toggle={toggle}/>
                    )}}
            </Toggler>
            <hr />
            <Favourite />
        </div>
    )
}

export default App
